

DROP TABLE IF EXISTS roads;

CREATE TABLE roads (
    id integer NOT NULL,
    geom geometry(MultiLineStringZ,27700),
    class character varying(22),
    roadnumber character varying(10),
    name1 character varying(150),
    formofway character varying(50)
);







CREATE INDEX sidx_f21dfexam_roads_geom ON roads USING gist (geom);
